import { createRouter, createWebHashHistory } from "vue-router";
import Home from "./router/Home"
import xingwen from "./router/xingwen"
import jiaose from "./router/jiaose"
import shijie from "./router/shijie"
import manhua from "./router/manhua"
import shequ from "./router/shequ"

const router = createRouter({
    history: createWebHashHistory(),
    routes: [{
            path: "/",
            component: Home
        },
        {
            path: "/xingwen",
            component: xingwen
        },
        {
            path: '/jiaose',
            component: jiaose
        },
        {
            path: '/shijie',
            component: shijie
        },
        {
            path: '/manhua',
            component: manhua
        },
        {
            path: '/shequ',
            component: shequ
        }
    ]
});

export default router;
